import './room.css'
import VideoPlayer from '../../components/videoPlayer/VideoPlayer'

export default function Room() {
    return (
        <div className='room'>
            <div className="roomLeft">
                <VideoPlayer/>
            </div>
            <div className="roomRight">Right</div>
        </div>
    )
}
